sourcesContent:
import styled from 'styled-components';
export const Div0 = styled.div`
    width: 95%;
    margin-left:2.5%;
    height: 100%;
    margin-top: 0%;
    float: left;
    background-color:white;

`
export const Div1 = styled.div`
    &.left{
        width:65%;
        height:85%;
        margin-top:5%;
    }

`
